class TestFlameGraph(unittest.TestCase):
    def test_basic(self):
        fg = FlameGraph(sample_data)
        fg.parse(sample_data)
        ofile = "result_flamegraph.html"
        fg.save(ofile)
        self.assertTrue(os.path.exists(ofile))
        os.remove(ofile)
    
    def test_load(self):
        with open("test.json", "w") as f:
            json.dump(sample_data, f)
        fg = FlameGraph()
        fg.load("test.json")
        ofile = "result_flamegraph.html"
        fg.save(ofile)
        self.assertTrue(os.path.exists(ofile))
        os.remove(ofile)
        os.remove("test.json")